function generatePlaceholderURL(options) {

    let baseUrl = "https://placehold.co/";

    // Size parameters (Width x Height)
    let sizeParam = `${options.width}x${options.height}`;

    // Background color (default is black if not provided)
    let bgColorParam = options.backgroundColor.replace("#", "");

    // Text color (default is gray if not provided)
    let textColorParam = options.textColor.replace("#", "");

    // Image format (default is PNG)
    let formatParam = options.format;

    // Optional text to be displayed in the image
    let textParam = options.text ? `?text=${encodeURIComponent(options.text)}` : "";

    // Construct final URL
    let imageUrl = 
      `${baseUrl}${sizeParam}/${bgColorParam}/${textColorParam}.${formatParam}${textParam}`;

    return imageUrl;
}

