async function downloadImage(imageUrl) {
    try {
        // Extract the file extension correctly, ignoring query parameters
        const urlWithoutQuery = imageUrl.split('?')[0]; // Remove query parameters
        const format = urlWithoutQuery.split('.').pop().toLowerCase();

        // Fetch the image as a blob
        const response = await fetch(imageUrl);
        if (!response.ok) {
            throw new Error(`Failed to fetch image: ${response.statusText}`);
        }
        const blob = await response.blob();

        if (format === "svg") {
            // Directly download the SVG as a file
            const link = document.createElement("a");
            link.href = URL.createObjectURL(blob);
            link.download = `downloaded_image.${format}`;
            link.click();

            // Clean up
            URL.revokeObjectURL(link.href);
        } else {
            // Create an Image object to load the blob for other formats
            const img = new Image();
            const blobUrl = URL.createObjectURL(blob);

            img.onload = function () {
                // Create a canvas and draw the image
                const canvas = document.createElement("canvas");
                canvas.width = img.naturalWidth;
                canvas.height = img.naturalHeight;
                const ctx = canvas.getContext("2d");
                ctx.drawImage(img, 0, 0);

                // Convert to the desired format
                const mimeType = format === "jpg" ? "image/jpeg" : `image/${format}`;
                const dataUrl = canvas.toDataURL(mimeType);

                // Trigger download
                const link = document.createElement("a");
                link.href = dataUrl;
                link.download = `downloaded_image.${format}`;
                link.click();

                // Clean up
                URL.revokeObjectURL(blobUrl);
            };

            img.src = blobUrl;
        }
    } catch (error) {
        console.error("Error:", error);
    }
}

