async function copyImageToClipboard(imageUrl) {
    try {
        // Ensure the page is focused
        if (!document.hasFocus()) {
            throw new Error("Document is not focused. Please interact with the page before copying.");
        }

        const pngUrl = imageUrl.replace(/\.(svg|jpeg|jpg|gif|png)(?=\?|$)/i, ".png");

        // Fetch the image as a blob
        const response = await fetch(pngUrl);
        if (!response.ok) {
            throw new Error(`Failed to fetch image: ${response.statusText}`);
        }

        const blob = await response.blob();

        // Copy the image blob to the clipboard
        await navigator.clipboard.write([
            new ClipboardItem({
                [blob.type]: blob,
            }),
        ]);
    } catch (error) {
        alert("Something went wrong: " + error.message);
    }
}

